INSERT INTO `article` VALUES (2,NULL,'오','2023-11-08 01:49:06.669326','오',NULL,NULL,'3101567072'),(9,NULL,'건의','2023-11-10 02:19:36.215599','건의 수정 안됨',NULL,NULL,'3101440165'),(10,NULL,'부족','2023-11-10 02:23:29.309516','족장',NULL,NULL,'3101440165'),(11,NULL,'내 사진 내려줘','2023-11-10 03:23:52.869863','내 사진 내려주세요!!',NULL,NULL,'3141184671'),(13,NULL,'건의함에서 어떻게 나가요','2023-11-10 04:53:49.805023','제곧내\n\n나가기 버튼 만들어주세요\n',NULL,NULL,'3156319791'),(14,NULL,'ㅇ','2023-11-10 05:10:17.302529','ㅇ',NULL,NULL,'3101440165'),(15,NULL,'ㅇ','2023-11-10 05:10:21.702272','ㅇ',NULL,NULL,'3101440165'),(425,NULL,'건의합니다.','2023-11-10 07:13:05.152631','김동현이 발표하게 해주세요.',NULL,NULL,'3141210351'),(426,NULL,'ID 425 답변드립니다','2023-11-10 16:44:12.000000','네. 동동이께서 발표하시기로 하셨습니다. 다들 박수!',NULL,NULL,'3141210351'),(430,NULL,'얼굴 합성은 어떡게 쓰는 것가요','2023-11-14 02:00:12.529968','말해조요',NULL,NULL,'3144895625'),(432,NULL,'건의합니다','2023-11-14 14:14:12.116231','김동동은 바보입니다\n저는 그렇다고 생각합니다\n운영자님도 그렇다고 생각하는지 답변해주세요',NULL,NULL,'3163044294'),(433,NULL,'건의하겠습니다','2023-11-14 14:14:54.712781','님들 저번주 일요일 내가 스터디할 때 염탐했는데 가영이랑 세울오빠 둘만 참석한거 봤습니다\n모두들 어디갔습니까????????????????\n저에게도 알려주새요 ',NULL,NULL,'3163044294'),(434,NULL,'이번엔 진짜 건의합니다','2023-11-14 14:15:22.710915','이거 왜 익명없습니까\n닉네임 제도 좀 해주세요\n저 익명 좋아합니다 ',NULL,NULL,'3163044294'),(435,NULL,'진환이오빠 안녕','2023-11-14 14:17:35.032604','오빠 나 예진이야\n내 기억상으로 오빠랑 동동이랑 같은 팀이라고 들었는데 맞음?\n오빠 잘 지내고 있어???\n근데 나 누군지 기억하지 ? ;;;; 잊은거아니지?;;;;;\n\n오빠 근데 오빠 안부도 좀 전해봐\n내가 듣기로는 이거 답변 해준다고 들었는데 답변해주새요\n\n답변 오면 알림 기능 이런거 업습니까 \n저 집착있어서 알림 없으면 답변해줄때까지 확인합니다 ㅡㅡ ;; \n\n알림기능\n건의합니다\n',NULL,NULL,'3163044294'),(436,NULL,'은근 중독성 있군요','2023-11-14 14:18:22.147219','그렇지만 저는 이제 자야합니다\n그렇기때문에 내일 다시 오겠슴니다\n\n이거 근데 누구누구보는거임\n다른사람들 보는거면 좀 부끄러운데 \n\n익명으로 제보합니다\n',NULL,NULL,'3163044294'),(437,NULL,'ㅈㅅ한데 이제봤는데 ai합성','2023-11-14 14:19:10.529839','은 뭡니까\n\n거기 ai 능력자가 잇어서 기능하나 넣은겁니까\n\n궁금합니다\n답변해주새요\n답변 건의합니다',NULL,NULL,'3163044294'),(438,NULL,'16일 4시 45분에 공개하는거','2023-11-14 14:20:24.114251','뭡니까\n\n저에게만 알려주세요\n저는 못보는데요\n\n혹시 발표를 공개한다는 말씀이신가요\n\n발표는 김동동시키세요\n건의합니다\n\n강력히 주장합니다\n좋은말 할때 김동동시키세요\n발표 능력자 입니다\n김동동의 잠재력을 잊지말아주세요 제발요',NULL,NULL,'3163044294'),(439,NULL,'마지막으로 건의합니다','2023-11-14 14:20:56.793008','제 노트장에도 무언가를 적어주세요\n이거 엠엠에 공지해주세요 저에게도 관심 좀 주세요\n관심ㅇ ㅣ필요합니다',NULL,NULL,'3163044294'),(440,NULL,'근데 이거 답변 어케봄?','2023-11-14 14:21:46.419776','답변란이 없는데 어케 보는건데이거 \n알려주세요 건의합니다\n\n카톡 메신저로 답변오는거는 사양합니다 ㅋ ',NULL,NULL,'3163044294'),(441,NULL,'관리자입니다.','2023-11-14 14:21:46.419776','1. 김동동 바보아닙니다.  2. 죽순 쫓겨났습니다. 3. 익명없습니다. 4.진환이가 기억안난답니다. 5. ai합성 추가되었습니다. 실험실 이용해주세요. 6.김동동 발표안합니다. 7.당신 노트에 적어드렸습니다. 8. 카톡메신저로 답변보냈습니다.',NULL,NULL,'3163044294'),(442,NULL,'건의합니다 김동동에게','2023-11-15 07:37:31.915603','내가 한입노트에 노트썻는데 왜 확인안해\n죽순쫓겨나서 다들 말안해줫나 ㅋ\n윤자현한테 물어바',NULL,NULL,'3163044294'),(443,NULL,'관리자입니다.2','2023-11-15 07:37:31.915603','확인하고 눈물흘렸습니다.',NULL,NULL,'3163044294'),(444,NULL,'ID13 답변드립니다','2023-11-16 17:59:17.000000','좌측하단에 메인으로 버튼 만들었습니다.',NULL,NULL,'3101440165');
